import "./App.css";
import Home from "./components/Home";
import Login from "./components/Login";
import { Routes, Route } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" />
        <Route path="/home" />
      </Routes>
      <>
        <Login />
        <Home />
      </>
    </div>
  );
}

export default App;
